    @Test
    public void testBasicTest() {
        FileBlock fb = new FileBlock();
        System.out.println(fb.getBlockName());
        System.out.println(fb.getBlockNumber());
        System.out.println(fb.getBlockOffset());
        System.out.println(fb.getBlockSize());
        System.out.println(fb.getDataLength());
        System.out.println(fb.getDataOffset());
        System.out.println(fb.getDataPosition());
        System.out.println(fb.getLastDataOffset());
        System.out.println(fb.getPositionOffset());
    }
    
    @Test
    public void testFromBytes() {
        try {
            byte[] b = "{\"lastModified\":1395043055774,\"name\":\"_0.cfs\",\"length\":18806,\"blocks\":[{\"columnName\":\"BLOCK-0\",\"blockSize\":16384,\"dataLength\":5855,\"dataOffset\":0,\"blockNumber\":0},{\"columnName\":\"BLOCK-1\",\"blockSize\":16384,\"dataLength\":8192,\"dataOffset\":5855,\"blockNumber\":1},{\"columnName\":\"BLOCK-2\",\"blockSize\":16384,\"dataLength\":1412,\"dataOffset\":14047,\"blockNumber\":2},{\"columnName\":\"BLOCK-3\",\"blockSize\":16384,\"dataLength\":925,\"dataOffset\":15459,\"blockNumber\":3},{\"columnName\":\"BLOCK-4\",\"blockSize\":16384,\"dataLength\":2422,\"dataOffset\":0,\"blockNumber\":4}],\"deleted\":false,\"lastAccessed\":1395043055774}".getBytes();
            FileDescriptor fd = FileDescriptorUtils.fromBytes(b, 16384);
            
            assertEquals(18806, fd.getLength());
            assertEquals(false, fd.isDeleted());
            assertEquals(1395043055774l, fd.getLastAccessed());
            assertEquals(1395043055774l, fd.getLastModified());
            assertEquals("_0.cfs", fd.getName());
            
            assertEquals(5, fd.getBlocks().size());
            
            assertEquals(0, fd.getBlocks().get(0).getBlockNumber());
            assertEquals(16384, fd.getBlocks().get(0).getBlockSize());
            assertEquals("BLOCK-0", fd.getBlocks().get(0).getBlockName());
            assertEquals(5855, fd.getBlocks().get(0).getDataLength());
            assertEquals(0, fd.getBlocks().get(0).getDataOffset());
            
            assertEquals(1, fd.getBlocks().get(1).getBlockNumber());
            assertEquals(16384, fd.getBlocks().get(1).getBlockSize());
            assertEquals("BLOCK-1", fd.getBlocks().get(1).getBlockName());
            assertEquals(8192, fd.getBlocks().get(1).getDataLength());
            assertEquals(5855, fd.getBlocks().get(1).getDataOffset());
            
            assertEquals(2, fd.getBlocks().get(2).getBlockNumber());
            assertEquals(16384, fd.getBlocks().get(2).getBlockSize());
            assertEquals("BLOCK-2", fd.getBlocks().get(2).getBlockName());
            assertEquals(1412, fd.getBlocks().get(2).getDataLength());
            assertEquals(14047, fd.getBlocks().get(2).getDataOffset());
            
            assertEquals(3, fd.getBlocks().get(3).getBlockNumber());
            assertEquals(16384, fd.getBlocks().get(3).getBlockSize());
            assertEquals("BLOCK-3", fd.getBlocks().get(3).getBlockName());
            assertEquals(925, fd.getBlocks().get(3).getDataLength());
            assertEquals(15459, fd.getBlocks().get(3).getDataOffset());
            
            assertEquals(4, fd.getBlocks().get(4).getBlockNumber());
            assertEquals(16384, fd.getBlocks().get(4).getBlockSize());
            assertEquals("BLOCK-4", fd.getBlocks().get(4).getBlockName());
            assertEquals(2422, fd.getBlocks().get(4).getDataLength());
            assertEquals(0, fd.getBlocks().get(4).getDataOffset());
        } catch (Exception e) {
            fail("exception is not expected ");
            e.printStackTrace();
        }
        
    }
    
